import React from "react";
import Leaderboard from "react-leaderboard";
import "./Style.css";

export class LeaderBoardPage extends React.Component {
  constructor(props) {
    super(props);
    let LeaderBoardData = JSON.parse(localStorage.getItem("LEADERBOARDDATA"));
    this.state = {
      users: LeaderBoardData ? LeaderBoardData : [],
    };
  }
  render() {
    return (
      <div className="leadboardBox">
        <Leaderboard users={this.state.users} paginate={1} asc={false} />
      </div>
    );
  }
}
export default LeaderBoardPage;
